import { registerActionType } from './action-type-registry';

/** Base action type */
export interface Action {
  /** Action type */
  readonly type: string;
}

/** Base action constructor */
export interface ActionConstructor {
  /** Action type */
  readonly type: string;

  /** Create a new action */
  new (): Action;
}

/**
 * Creates an action factory that adds a common group string to each action type
 * @param group Common action type group
 * @returns An action factory
 */
export function ActionGroup(group: string): (type: string) => ActionConstructor {
  return (type) => Action(`[${group}] ${type}`);
}

/**
 * Creates a new base action with a specified type
 * @param type Action type
 * @returns A base action class
 */
export function Action(type: string): ActionConstructor {
  registerActionType(type);
  return class BaseAction {
    static readonly type = type;
    readonly type = type;
  };
}

import { ReplaySubject } from 'rxjs';

/** Object on which cleanup functions can be registered */
export interface DestructorScope {
  /**
   * Register a cleanup function
   * @param cb Cleanup callback function
   */
  onDestroy(cb: () => void): void;
}

/**
 * Determines whether an object is destructor scope like
 * @param obj Value to test
 * @returns true if the object seems to be a destructor scope, otherwise false
 */
export function isDestructorScopeLike(obj: unknown): obj is DestructorScope {
  const isObject = typeof obj === 'object' && obj !== null;
  return isObject && 'onDestroy' in obj && typeof obj.onDestroy === 'function';
}

/**
 * A subject type that is associated with a destructor scope.
 * When the cleanup function is run the subject emits a single
 * undefined value and immediately completes
 */
export class ScopedDestructorSubject extends ReplaySubject<void> {
  /**
   * Creates a new subject and attaches cleanup to the destructor scope
   * @param scope Associated scope
   */
  constructor(scope: DestructorScope) {
    super(1);

    scope.onDestroy(() => {
      this.next();
      this.complete();
    });
  }
}

import { ConnectionPositionPair, Overlay } from '@angular/cdk/overlay';
import { TemplatePortal } from '@angular/cdk/portal';
import { Directive, ElementRef, HostListener, inject, Input, TemplateRef, ViewContainerRef } from '@angular/core';

/**  Context passed to hover content templates */
export interface HoverContext<T = unknown> {
  /** Data provided by the user for use inside the content template */
  $implicit: T;
}

/** Hover overlay directive to be used across the application */
@Directive({
  selector: '[hraHover]',
  standalone: true,
})
export class HoverDirective<T = unknown> {
  /**  Setter for the content to be displayed in the overlay */
  @Input('hraHover')
  set content(content: TemplateRef<HoverContext<T>>) {
    this.portal = new TemplatePortal(content, this.viewContainerRef, this._data);
    this.updateContent();
  }

  /** Setter for the context that is to be displayed in the portal attached to the overlay */
  @Input('hraHoverData')
  set data(data: T) {
    this._data = { $implicit: data };
    if (this.portal) {
      this.portal.context = this._data;
      this.updateContent();
    }
  }

  /**  Reference to the element that the directive is attached to */
  private readonly el: Element = inject(ElementRef).nativeElement;

  /**  Reference to the overlay that is created when the userhovers over the element along with its position setting */
  readonly overlayRef = inject(Overlay).create({
    positionStrategy: inject(Overlay)
      .position()
      .flexibleConnectedTo(this.el)
      .withPositions([
        new ConnectionPositionPair({ originX: 'end', originY: 'bottom' }, { overlayX: 'end', overlayY: 'top' }),
        new ConnectionPositionPair({ originX: 'start', originY: 'top' }, { overlayX: 'start', overlayY: 'bottom' }),
        new ConnectionPositionPair({ originX: 'start', originY: 'bottom' }, { overlayX: 'start', overlayY: 'top' }),
        new ConnectionPositionPair({ originX: 'end', originY: 'top' }, { overlayX: 'end', overlayY: 'bottom' }),
      ])
      .withPush(true),
  });

  /** Reference view container that the directive is attached to */
  private readonly viewContainerRef = inject(ViewContainerRef);

  /** Store the data that is passed into the data input property */
  private _data?: HoverContext<T>;

  /** Portal that is created to display the overlay */
  portal?: TemplatePortal<HoverContext<T>>;

  /** Function to handle the mouse over event to attach the portal and display the hover content */
  @HostListener('mouseover')
  startHover(): void {
    const { overlayRef, portal } = this;
    if (!overlayRef.hasAttached() && portal) {
      overlayRef.attach(portal);
    }
  }

  /** Function to handle the mouse out event to detach the portal  */
  @HostListener('mouseout')
  endHover(): void {
    const { overlayRef } = this;
    if (overlayRef.hasAttached()) {
      overlayRef.detach();
    }
  }

  /** Function to handle the updation of overlay with up to date content when the input changes */
  private updateContent(): void {
    const { overlayRef, portal } = this;
    if (overlayRef.hasAttached() && portal) {
      overlayRef.detach();
      overlayRef.attach(portal);
    }
  }
}

import { ChangeDetectorRef, inject } from '@angular/core';
import { Any } from '@hra-ui/utils/types';
import { StateToken, Store } from '@ngxs/store';
import { MonoTypeOperatorFunction, Observable, takeUntil, tap } from 'rxjs';
import { injectDestroy$ } from '../on-destroy/on-destroy';

/** Selector type for select style functions */
export type StateSelector<T> = ((...args: Any[]) => T) | StateToken<T>;

/** `select$` configuration options */
export interface SelectOptions {
  /** Whether to mark the containing view for change detection on emits. Defaults to true. */
  notifyOnChange?: boolean;
}

/**
 * Marks a view for change detection whenever a new value is emitted
 * @param options Options to explicitly disable marking
 * @returns A rxjs operator
 */
function markForCheck<T>(options?: SelectOptions): MonoTypeOperatorFunction<T> {
  const notifyOnChange = options?.notifyOnChange ?? true;
  const cdr = inject(ChangeDetectorRef, { optional: true });
  if (notifyOnChange && cdr) {
    const markFn = () => cdr.markForCheck();
    return tap({ next: markFn, error: markFn, complete: markFn });
  }

  return (source) => source;
}

/**
 * Creates an observable emitting parts of the state. The observable's lifetime
 * is automatically tied to the injection context where this is called.
 * @param selector State selection function or token
 * @param options Additional select options
 * @returns An observable of the selected state
 */
export function select$<T>(selector: StateSelector<T>, options?: SelectOptions): Observable<T> {
  return inject(Store)
    .select(selector as StateToken<T>)
    .pipe(takeUntil(injectDestroy$()), markForCheck(options));
}

